.banner{
    .swiper-container {
        max-width: 100%;
        height: 100%;
    }
    .swiper-slide {
        position: relative;
        // background-position: center;
        // background-size: cover;

        img{
            width: 100%;
            height: 700px;

        }

        h1{
            max-width: 32%;
            font-size: 51px;
            color: $over-color;
            letter-spacing: 1px;
            position: absolute;
            top: 50%;
            left: 10%;
        }
      }
}

// banner ends

// services start

.services{
    padding: 30px 0 60px 0;
    


   
}


// services ends


// courses start
.courses{
    padding: 30px 20px 40px 20px;
    background: $secondary-bg-color;
    text-align: center;
    .filter{
        display: inline-block;
        .btn{
            margin-top: 36px;
            background: $over-color;
            // padding: 0;
            width: 200px;

            margin-left: 10px;

            &:hover{
                background: $primary-color;
                color: $over-color;
                cursor: pointer;
            }

         
        }

        .act{
            background: $primary-color;
            color: $over-color;
            &:hover{

                cursor: default;
            }
        }


    }

    .cards{
        margin-top: 30px;
        >div{
            max-width: 30%;
            background: $over-color;
            padding:0px;
            position: relative;

            .for-service-description{
                margin:30px;
                display: flex;
                flex-direction: column;
                h4{
                    width: 300px;
                    margin:auto;
                    // border: 1px solid $primary-color;
                    -webkit-box-shadow: 3px 3px 13px 0px rgba(0,0,0,0.75);
                    -moz-box-shadow: 3px 3px 13px 0px rgba(0,0,0,0.75);
                    box-shadow: 3px 3px 13px 0px rgba(0,0,0,0.75);
                    border-radius: 300px;
                    margin-top: -55px;
                    position: relative;
                    background: $over-color;
                    z-index:100;
                    height: 40px;
                    line-height: 40px;
                }

                p{
                    text-align: left;
                }
                span, small{
                    text-align: left;
                    display: inline-block;
                    margin-top: 10px;
                    font-size: 14px;
                }

                small{
                    margin-top: 0px;
                }
            }

            strong{
                position: absolute;
                right: 0;
                top: 5%;
                background: $primary-color;
                color:$over-color;
                width: 40%;
                height: 50px;
                border-top-left-radius: 50px;
                border-bottom-left-radius: 50px;
                line-height: 50px;

            }

            img{
                width:100%;
                height: 350px;
            }
            
        }
    }
}

// courses ends

// about start

.about{
    padding: 30px 20px 40px 20px;

    .about-container{
        display: flex;
        justify-content: space-between;

        &__image{
            max-width: 40%;
        }

        &__description{
            max-width: 60%;
            margin-top: 35px;
            font-size: 18px;

            &--counter__container{
               
                margin-top:34px;      

                display: flex;

                justify-content: flex-start;
                > div{
                    text-align: center;
                    strong{
                        font-size: 28px;
                        font-weight: 400;
                    }
                }
                .counter{
                    margin:20px;
                    // display: table-cell;
                    font-size:50px;
                    background-color: $over-color;
                    width:130px;
                    border-radius: 50%;
                    border:6px solid $primary-color;
                    height:130px;
                    // vertical-align: middle;
                    display: flex;
                    align-items: center;
                    justify-content: center;
                }
            }

        }
    }
}


// about ends

// blog starts
.blog{
    padding:30px 0 40px 0;
    max-width: 100%;

    h2{
        color: $over-color;
    }

    .swiper-container {
        width: 100%;
        padding-top: 50px;
        padding-bottom: 50px;
    }
    .swiper-slide {
        background-position: center;
        background-size: cover;
        width: 500px;
        height: 700px;
        // background: #fff;

        .cards{

            >div{
                max-width: 100%;
                background: #fff;

                
                .for-service-image{
                    text-align: center;
                    img{
                        display: inline-block;
                        height: 350px;
                        width: 100%;
                    }
                }

                .for-service-description{
                    span{
                        display: block;
                        margin-top: 8px;
                    }
                }
            }
        }
    }


}

// blog ends

// testimonials start

.testimonials{
    padding: 30px 70px 40px 70px;
    // max-width: 100%;
    
    .swiper-second-container {
        // width: 100%;
        padding-top: 50px;
        padding-bottom: 50px;
        margin-top: 40px;
    }
    .swiper-slide {
        background-position: center;
        background-size: cover;
        // max-width: 80% !important;
        -webkit-box-shadow: 3px 3px 13px 0px rgba(0,0,0,0.75);
            -moz-box-shadow: 3px 3px 13px 0px rgba(0,0,0,0.75);
            box-shadow: 3px 3px 13px 0px rgba(0,0,0,0.75);

        .swiper-cards{
            display: flex;
            // max-width: 100%;
            position: relative;            
            >div{
                padding:120px 30px 45px 60px;

                p{
                    font-size: 18px;
                }

                h4{
                    font-size: 26px;
                    color: $primary-color;
                    font-weight: 400;
                    margin-top: 20px;

                    span{
                        color: $secondary-color;
                        font-size: 14px;
                        display: block;
                    }
                }
            }

            .absolute-image{
                width: 80px;
                height: 80px;
                border-radius: 80px;
                position: absolute;
                top: -35px;
                left: 45%;
                overflow: hidden;

                img{
                    width: 100%;
                    height: 100%;
                }
            }


            .testi-up, .testi-down{
                position: absolute;
                top:0;
                left: 0;

                img{
                    height: 130px;

                }
            }

            .testi-down{
                top: auto;
                left: auto;
                right: 0%;
                bottom: 0%;
            }
            
        }
    }
}

// testimonials ends


// clients start

.clients{
    background: $secondary-bg-color;
    padding: 30px 20px 40px 20px;

    .clients-listing{

        max-width: 100%;
        overflow: hidden;
        margin-top: 40px;

        img{
            height: 200px;
        }

        .swiper-container {
            width: 100%;
            height: 100%;
        }
        .swiper-slide {
            text-align: center;
            font-size: 18px;
            /* Center slide text vertically */
  
            display: flex;
            -webkit-box-pack: center;
            -ms-flex-pack: center;
            -webkit-justify-content: center;
            justify-content: center;
            -webkit-box-align: center;
            -ms-flex-align: center;
            -webkit-align-items: center;
            align-items: center;
          }
 
    }

}


// clients end


// contact us start

.contact{
    padding: 30px 20px 40px 20px;
    background: url('../images/banner_1.jpg') center center fixed no-repeat;
    max-width:100%;
    background-size: cover;

    h2{
        color:$over-color;    
    }

    .form-box{
        margin-top: 40px;
        display: flex;
        justify-content: space-between;

        .company-information{
            max-width: 30%;
            display: flex;
            flex-direction: column;
            h5{
                font-size: 30px;
                color: $over-color;
                font-weight: 400;
                letter-spacing: 1px;
            }

            > div{
                display: flex;
                justify-content: flex-start;
                margin-top: 28px;
                span,small{
                    font-size: 18px;
                    color: $over-color;
                }

                span{
                    font-size: 28px;
                    margin-right: 25px;
                }
            }
        }

        form{
            width: 40%;
            display: flex;
            flex-direction: column;

            input, textarea{
                margin-bottom: 22px;
                padding: 0 10px;
                height: 42px;
                width: 100%;
                font-size: 16px;
            }

            textarea{
                height: auto;
                max-width: auto;
            }

            input[type=submit]{
                max-width: 120px;
                display: inline-block;
                border: none;
                cursor: pointer;
            }
        }
    }
}


// contact us end

// footer starts

.footer{
    background: $footer-color;
    padding: 40px 20px;

    .center{
        display: flex;
        justify-content: space-between;
    }

    

    &-middleDiv, &-lastDiv, &-firstDiv{
        display: flex;
        flex-direction: column;
        max-width: 30%;

        button{
            background: none;
            border:none;
            outline: 0;
        }

        h5{
            font-size: 22px;
            color: $over-color;
            margin-bottom: 10px;
        }

      
        p{
            margin-top: 15px;
            font-size: 16px;
            color: $over-color;
        }

        a{
            margin-top: 20px;
        }
    }

    &-middleDiv{
        button{
            background: none;
            outline: 0;
            border:0;
            font-size: 16px;
            color: $over-color;
            font-weight: 400;
            margin-top: 8px;
    
            &:hover{
                color: $primary-color;
                cursor: pointer;
            }
        }
    }

   
}

// footer ends





